import '../styles/Logement.css'
import { useParams } from 'react-router-dom';
import Api from './Api'
import { Swiper, SwiperSlide } from 'swiper/react';

function Logement() {
    const data = Api();
    const idUrl = useParams();
    const loge = []
    data.forEach(function (res) {
        if (idUrl.id === res.id) {
            loge.push(res)
        }

    });
    console.log(loge)

    return (
        <div className='kasa-containere-slide'>
            {loge.map((loge, id) => ( 
                <div key={id}>
                <Swiper
                spaceBetween={50}
      slidesPerView={3}
      onSlideChange={() => console.log('slide change')}
      onSwiper={(swiper) => console.log(swiper)}
      >
                <SwiperSlide><img src={loge.pictures[0]} alt='' className='kasa-image-logement' /></SwiperSlide>
                <SwiperSlide><img src={loge.pictures[1]} alt='' className='kasa-image-logement' /></SwiperSlide>
                <SwiperSlide><img src={loge.pictures[2]} alt='' className='kasa-image-logement' /></SwiperSlide>
                <SwiperSlide><img src={loge.pictures[3]} alt='' className='kasa-image-logement' /></SwiperSlide>
                <SwiperSlide><img src={loge.pictures[4]} alt='' className='kasa-image-logement' /></SwiperSlide>
                </Swiper>
                </div>
                ))}   
        </div>

    )

}

export default Logement
